import goBack_white from "../../images/goBack_white.png";
import classes from "./TrainingAndUpload.module.css";

function TrainingAndUpload() {
    return (
        <div className={classes.outerContainer}>
            <div className={classes.header}>
                <img src={goBack_white} className={classes.goBack} alt="返回" />
                <div className={classes.title}>訓練模型</div>
            </div>
            <div>
                <div>
                    <div>上傳資料</div>
                    <div>察看進度</div>
                </div>
                <div></div>
                <div>
                    <img />
                    <div>
                        <div></div>
                        {/* <button></button> */}
                    </div>
                </div>
            </div>
        </div>
    );
}

export default TrainingAndUpload;
